import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import {useNavigate, useLocation} from 'react-router-dom';

function TestDisplay() {
    const navigate = useNavigate();
    const{state} = useLocation();
    const{budget} = useLocation();
    const{maxAge} = useLocation();

    useEffect(() =>{
        Axios.post("http://localhost:3001/testFilter").then((response)=> {
            setInsuranceList(response.data)
          })

        },[])


    return (
        <>
        <table border="1" >
        <tr>
            <th>Insurance Name</th>
            <th>Insurance Type</th>
            <th> Plan Name </th>
            <th> Yearly Cost </th>
            <th> Coverage Details </th>
        </tr>
        </table>
            <h1>Insurance List </h1>
            { state.insuranceList.map((val,key) => {
                console.log(state.budget + " inside TestFilter.js" +state.maxAge)
                console.log("val.plans.yearlyCost = " +val.plans.yearlyCost)
                console.log("val.plans.maxAge = " +val.plans.age)

                if(val.plans.yearlyCost <= state.budget && val.plans.age <= state.maxAge) {

                    return(
                        <div key = {key}>
                            {"Insurance Name: "} {val.insuranceName} {" "}
                            <div>
                                {"Type: "} {val.insuranceType} {" "}
                            </div> 
                            <div>
                                {"Yearly Cost: "} {val.plans.yearlyCost} {" "}
                            </div>

                        </div>
                    );
                }
            })}
        </>  
    )
}

export default TestDisplay;
